import { Fragement } from "reaact";

import mealsImg from '../../assets/meals.jpg';
import classes from './Header.module.css';

const Header = (props) => {
  return <Fragement>
      <header className={classes.header} >
          <h1>FoodOrder</h1>
          <button>Cart</button>
      </header>
      <div className={classes["main-image"]} >
          <img src={mealsImg}/>
      </div>
  </Fragement>;
};

export default Header;
